  cursor: pointer;
  font-size: 1em;
  background: transparent;
}

[class^=button-]:disabled {
  opacity: 0.8;
  cursor: not-allowed;
  position: relative;
}

.sending-form:disabled::before {
  content: "";
  position: absolute;
  right: 10px;
  top: 50%;
  margin-top: -11px;
  width: 10px;
  height: 10px;
  border: 4px solid;
  border-left-color: transparent;
  border-radius: 50%;
  animation: rotate infinite 0.6s linear;
}

.close {
  font-size: 18px;
  color: #fff;
  cursor: pointer;
}

@keyframes rotate {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}
.header {
  grid-area: header;
  background: var(--first-color);
  display: flex;
