  justify-content: flex-end;
  margin: 0 2em;
}
.header__container {
  display: grid;
  width: 100%;
  grid-template-columns: repeat(2, auto);
  grid-template-rows: 100px;
  position: relative;
}

.navbar {
  width: 100%;
  transform: translateX(calc(100% + 100vw));
  display: flex;
  justify-content: center;
  align-items: center;
