    justify-content: flex-end;
  }
}
@media (min-width: 1024px) {
  .navbar {
    background: var(--white);
  }
}
.navbar.active {
  transform: translateX(0);
}
.navbar__nav {
  list-style-type: none;
  padding: 1em 2em;
  text-align: center;
}
.navbar__item {
  margin-bottom: 0.8em;
  padding: 1.2em 0.5em;
  position: relative;
}
.navbar__item::before {
  content: "";
  height: 3px;
  width: 100%;
  right: 0;
  position: absolute;
  bottom: -5px;
  background: var(--second-color);
  transform: scaleX(0);
}
.navbar__item:hover::before {
  transform: scaleX(0.5);
}
.navbar__link {
  text-decoration: none;
  color: inherit;
  position: relative;
  padding: 0.7em 1em;
  font-size: 3em;
  color: var(--white);
}
@media (min-width: 1024px) {
  .navbar__link {
    font-size: 1.5em;
  }
}
.navbar__list {
  display: block;
  list-style: none;
}
.navbar__sub-items {
  list-style-type: none;
  padding: 1em 2em;
  text-align: left;
  display: none;
  position: absolute;
  top: 50px;
  left: 50%;
  transform: translateX(-50%);
  z-index: var(--z-modal);
}
.navbar__sub-items.jsactive {
  display: block;
}

.hamburguer span {
  display: block;
  position: absolute;
  height: 4px;
  width: 100%;
  background: var(--white);
  opacity: 1;
  left: 0;
  transition: all 0.25s ease-in-out;
}
.hamburguer span:nth-child(1) {
  top: 0;
}
.hamburguer span:nth-child(2) {
  top: 40%;
}
.hamburguer span:nth-child(3) {
  bottom: 0;
}
.hamburguer.active span:nth-child(1) {
  top: 50%;
  transform: rotate(-45deg);
}
.hamburguer.active span:nth-child(2) {
  opacity: 0;
}
.hamburguer.active span:nth-child(3) {
  top: 50%;
  transform: rotate(45deg);
}

.nav {
  width: 100%;
  display: flex;
  align-content: center;
  justify-content: center;
  padding: 0.8em 0;
}
.nav__list {
  display: flex;
  flex-wrap: wrap;
