    background: transparent;
    top: initial;
    width: auto;
    height: auto;
    position: initial;
    max-width: 1920px;
  }
  .navbar__link {
    font-size: var(--font-size-sm);
  }
  .navbar__nav {
    display: flex;
    -ms-flex-direction: row;
    flex-direction: row;
    justify-content: flex-end;
    -ms-flex-align: center;
    align-items: center;
    margin: 0;
  }
  .navbar__item {
    margin-bottom: inherit;
    padding: 0.5em 1.2em;
  }
}
.input, [class^=input-] {
  box-sizing: border-box;
  padding: 0.5em;
  border: none;
  background: transparent;
}
.input:focus, [class^=input-]:focus {
  outline: none;
}

.input--primary {
  border-bottom: 5px solid var(--white);
  color: var(--white);
}
.input--lg {
  width: 100%;
  max-width: 600px;
  font-size: var(--font-size-md);
}
.input--md {
  width: 100%;
  max-width: 450px;
  font-size: var(--font-size-sm);
}

.card {
  position: relative;
  width: 300px;
  height: 200px;
}
@media (max-width: 576px) {
  .card {
    width: 100%;
  }
}
.card-container {
  background: var(--white);
  border-radius: 0.8em;
  box-shadow: 0 3px 6px rgba(0, 0, 0, 0.2);
  width: 100%;
  height: 100%;
  position: absolute;
  transition: all 0.4s;
  transform-style: preserve-3d;
}
.card-container .monster-title {
  font-size: calc(var(--font-size-sm) * 1.5);
  color: var(--second-color);
  margin-top: 0;
  margin-bottom: 0.3em;
}
.card-container .monster-sub-title {
  font-size: var(--font-size-sm);
  color: var(--second-color);
