.button-primary {
  background: var(--second-color);
  color: var(--white);
  padding: 0.5em 1.5em;
  border-radius: 1.5em;
}

.theme--primary {
  --neutral-color: #F7F7F7;
  --first-color: #282D31;
  --second-color: #00cbff;
  --light-grey:##F2F0F0;
}
.theme--secondary {
  --neutral-color: #F7F7F7;
  --first-color: #00cbff;
  --second-color: #282D31;
  --light-grey:##F2F0F0;
}

